import './index.scss';

import {Link} from 'react-router-dom';

function Logo() {
    return (
      <Link top='App.js' className='logo' translate="no">
        <span className='logo__dots'>
          <span className='logo__dot'></span>
          <span className='logo__dot'></span>
          <span className='logo__dot'></span>
          <span className='logo__dot'></span>
        </span>
        <span className='logo__text'>
          <span>b</span>
          <span>e</span>
          <span>n</span>
          <span>k</span>
          <span>o</span>
        </span>
      </Link>
    );
}
  
export default Logo;
